import React, { Component } from 'react';
import BuscarCliente from './cliente';
import BuscarProducto from './buscarproducto';
class Principal extends Component {
    render() {
        return (
            <div className="contenedorww">
                <div className="row">
                    <BuscarCliente />
                </div>
                <div className="row">
                    <BuscarProducto />
                </div>
            </div>
        );
    }
}

export default Principal;
